INSERT INTO `Repositories` VALUES (1,'仓库阶音连业六','想严员气必省满团资五成样给共。还果研少文除属类究自们热划油上。全统强书他意但研石解该器局指支候准习。对图适证面观提他被干地劳说。科山群战反划里看队型家持清断。','telnet://ovojgqdv.sa/qkkghanupg',NULL,1,100000000,NULL,100000000,NULL,'2019-11-20 15:38:42','2019-11-20 15:38:42',NULL),(2,'仓库传如入气外今','术况权它自制决必才种引小七装已山到。成以都际年包济多常等接多严名。红斗美角酸上样身权手界前内。同属原断月上空院况明集信有。作料型出程战门了构五外活包结头次。儿级加放究价间满每京目十也义。','ftp://xmsdyzvw.kh/yusniyl',NULL,1,100000000,NULL,100000000,NULL,'2019-11-20 15:38:43','2019-11-20 15:38:43',NULL),(3,'仓库置见车立响','示拉交利属维属京战公计适或。革该料何率族铁出被根验口起应制参。社四动满局用处做六极复自。严关和到江无保此打装小面是二四。什研容快经使等周油国府进整作意。','gopher://eretjv.hu/wfj',NULL,1,100000000,NULL,100000000,NULL,'2019-11-20 15:38:44','2019-11-20 15:38:44',NULL),(4,'仓库际直书果报间儿','百调须现非者效争话前斯则商得已种。务王家却细支专统精备派水空品立。世事变在美周西感式易完六存本。每需我作空打道识作间计格度。','mid://vechx.ua/jnuemqnrn',NULL,1,100000001,NULL,100000001,NULL,'2019-11-20 15:38:44','2019-11-20 15:38:44',NULL),(5,'仓库得那点运报','按元道万关性派许压类易又白速线。几利感江称象马群联状形据上构。深复入作圆目系任引热江决八展等这精油。时适商干就公还手识程认她民装调步。','prospero://rtxu.sa/olwzrs',NULL,1,100000001,NULL,100000001,NULL,'2019-11-20 15:38:45','2019-11-20 15:38:45',NULL),(6,'仓库便道造','走目存求个至又收深克天持发。算太身广能权度极分同华低来理外厂则。期点他就同必率备深人住多象取。物做就油深力需要头保起达角经光。','telnet://zvdqwybtwo.uy/gmngl',NULL,1,100000001,NULL,100000001,NULL,'2019-11-20 15:38:46','2019-11-20 15:38:46',NULL),(7,'仓库代论造','证山报报习下度放党切声须火西。际提号府到正或情矿置话住白积各。压照车被它分取利圆热按日始龙般政。','gopher://rcmp.al/mysn',NULL,1,100000000,1,100000000,NULL,'2019-11-20 15:38:46','2019-11-20 15:38:46',NULL),(8,'仓库际根单','住究极导府务即给元前除向拉种八地济。立门除各类王值细证效门公存。务出求题性常处达性治认立圆压向使办。','mailto://fbtcgudrj.fr/nkmgiw',NULL,1,100000000,1,100000000,NULL,'2019-11-20 15:38:47','2019-11-20 15:38:47',NULL),(9,'仓库传组素民维','许政都阶石集流进治们基发变精。况查张增到表展运每名来些技使。定京线二信何团其果志及象记十际证。确持教过复形产例争织花由较委者信又不。酸期元部本交经情华十文色重育。','cid://ogkv.cv/otkmzikn',NULL,1,100000000,1,100000000,NULL,'2019-11-20 15:38:47','2019-11-20 15:38:47',NULL),(10,'仓库需快观','论而质展调引电过例满米万。机全由术步织比五般半三历算种连集。何第就积统飞前口比厂研多究之。低集物花更将话上文各单六具最数包光。话质油五没研农以每确写把才特。红着花见众路高还半界更价道标数于。','cid://qebhbd.nu/cgjxf',NULL,1,100000000,2,100000000,NULL,'2019-11-20 15:38:48','2019-11-20 15:38:48',NULL),(11,'仓库选便带听即','体这具品你常果海当难派意化我土。主对标细满至直议儿非按和变级众类劳。你象类车点转方原长就离转期明。发族结又据况象内众教圆定消族。容权省东市界济亲况信还过建铁。车口有之会对资手易府温斗教边济长。一务少指正影问都过委联再便由管电。','wais://fococ.nt/fqgs',NULL,1,100000000,2,100000000,NULL,'2019-11-20 15:38:49','2019-11-20 15:38:49',NULL),(12,'仓库将联市热九知','且并正事道持没上金类于造。比团今往来装革五很面半有知同改华事。例受级万单光海自消们新要。基飞料及步划并高题领片科界亲设。','news://klpzicuff.pt/zifzjwb',NULL,1,100000000,2,100000000,NULL,'2019-11-20 15:38:49','2019-11-20 15:38:49',NULL),(13,'仓库日还家过四','农通线角天如按院领属划取并。革关影大单受管规太样力眼联花其了。第难张六务总影中心信资电水。价许南计般取想采解号基术元么意还军花。政声运维今活果论术济很些报林然时。查起才真放一只听条况位后知素保。样量集作转速风更率候响家合从。','mid://lkg.gi/ysvs',NULL,1,100000000,3,100000000,NULL,'2019-11-20 15:38:50','2019-11-20 15:38:50',NULL),(14,'仓库约维新命什资得','风细处积周酸往加劳厂按条发。适林包队本保事华直况般场选许史感必。式整本广构为目验值龙亲式立证。如值八着九半然市采圆它料断。率信切立验指意会所米受收。始之传华力书想极百状老科化可需拉地。','mailto://sskhfkfi.tr/qtkq',NULL,1,100000000,3,100000000,NULL,'2019-11-20 15:38:51','2019-11-20 15:38:51',NULL),(15,'仓库气细新见','体料原装选平看进省且周联。广拉响参林二儿理小最老算有造太着记政。电给明张空律立热接行火步不办想。件放性被王毛和改组装什为然。数几他装值门打价作产世平志压。道效表合越离群小更给表委高。开决规生起按很组更结论公候做管商。','gopher://dta.jo/pgmzmgrt',NULL,1,100000000,3,100000000,NULL,'2019-11-20 15:38:51','2019-11-20 15:38:51',NULL),(16,'rainbow','血缘接口文档',NULL,'b__SPbh-R4tDYiIWfp5vhZhej3ENInC3',1,100000012,NULL,100000012,NULL,'2019-11-21 02:11:02','2019-11-25 02:31:19',NULL),(17,'ad-hoc-test','adhoc接口管理',NULL,'NJ6cULpdoJZKvL6aoNDRlm2GfAtyajH9',1,100000014,NULL,100000014,NULL,'2019-11-21 06:14:23','2019-11-21 06:14:23',NULL),(18,'adhoc','大数据即席查询',NULL,'2C3Orw5wLSiWwkOSKSa4_l9Vqcin8Oh1',1,100000016,NULL,100000016,NULL,'2019-11-21 07:08:15','2019-11-29 06:00:06',NULL),(19,'sms','短信',NULL,'TVye77jQNJGH4GXjXmWz5YWtopDuY6C3',1,100000020,NULL,100000020,NULL,'2019-11-21 07:18:27','2019-11-21 07:18:27','2019-12-02 06:51:28'),(20,'7-11','数据血缘集市',NULL,'bDjRBMrqRLMZT_ozNujV-CzMnLRTQb0i',1,100000020,NULL,100000020,NULL,'2019-12-02 06:51:25','2019-12-06 10:01:03',NULL);
